import iconCart from "./icon-cart.svg";
import iconClose from "./icon-close.svg";
import iconDelete from "./icon-delete.svg";
import iconMenu from "./icon-menu.svg";
import iconMinus from "./icon-minus.svg";
import iconNext from "./icon-next.svg";
import iconPlus from "./icon-plus.svg";
import iconPrevious from "./icon-previous.svg";
import imageAvatar from "./image-avatar.png";
import imageProduct1 from "./image-product-1.jpg";
import imageProduct2 from "./image-product-2.jpg";
import imageProduct3 from "./image-product-3.jpg";
import imageProduct4 from "./image-product-4.jpg";
import logo from "./logo.svg";

const img = {
    iconCart,
    iconClose,
    iconDelete,
    iconMenu,
    iconMinus,
    iconNext,
    iconPlus,
    iconPrevious,
    imageAvatar,
    imageProduct1,
    imageProduct2,
    imageProduct3,
    imageProduct4,
    logo,
};

export default img;
